import { Component, Input } from '@angular/core';
import { TrmService } from '@vacunas/shared/services/trm.service';
let NavbarComponent = class NavbarComponent {
    constructor(trmService) {
        this.trmService = trmService;
        this.valorTrm = '';
    }
    ngOnInit() {
        var f = new Date();
        let fecha = f.getFullYear() + '-' + (f.getMonth() + 1) + '-' + f.getDate();
        this.trmService.consultarPorFuera(fecha).subscribe(data => (console.log(data), this.valorTrm = data[0].valor));
    }
};
NavbarComponent.ctorParameters = () => [
    { type: TrmService }
];
NavbarComponent.propDecorators = {
    items: [{ type: Input }]
};
